function sortDictionary(inputDict) {
  // Convert object to array of [key, value] pairs
  const entries = Object.entries(inputDict);

  // Sort the entries based on keys (first element of each pair), then values if needed
  entries.sort((a, b) => a[0].localeCompare(b[0]));

  // Convert back to an object with sorted key-value pairs
  const outputDict = {};
  for (const [key, value] of entries) {
    outputDict[key] = value;
  }
  return outputDict;
}
// Example usage:
